const TestHome = () => {
  return (
    <div style={{ height: "100vh", width: "100%", background: "red" }}>
      <div style={{ height: "10vh" }}></div>
      <div style={{ height: "80vh", background: "gray" }}></div>
    </div>
  );
};

export default TestHome;
